import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Main from './Pages/Main';

const Router = () => {
	return (
		<React.Fragment>
			<Switch>
				<Route path={'/'}>
					<Main />
				</Route>
			</Switch>
		</React.Fragment>
	);
};

export default Router;
